import React, { Component } from 'react';

class Accueil extends Component {
  
  render() { 
    return (
    <div class="demo-wrap">
                <div class="demo-content">
                <div className="py-4">
              <h2 id="h2accueil">VOUS ETES PASSIONNÉ DE CUISINE ?</h2>
              <p className="mb-4 pb-2 px-md-5 mx-md-5">
              Nous sommes <span id="spanheader">un centre de formation de cuisine</span>
              <br/> qui propose des ateliers à nos élèves à partir de 12 ans,<br/>
               mais aussi à des gens particuliers.<br/>
               Des personnes qui veulent apprendre à  cuisiner afin de manger correctement. <br/><br/>
              <p> <a href="" id="lien"> <span id="rejoin"> Nous rejoindre </span></a> </p>
              
              </p>
            </div>
            </div>


            <div className="container-fluid">
                <div className="row">
                  
                </div>
            </div>
         </div>
    )
  }
}
export default Accueil;
